11.body:
各种操作系统内核在最初启动时，通常都需要完成以下的几项工作： 清零BSS区域 保存一些必要的信息 启用内存分页 设置中断/异常向量表 建立栈以支持函数调用 ... ... 每一项初始工作都具有特定的作用，并且与后续的工作相关。 这一节作为起步阶段，首先完成 第 1 步和第 5 步 ，其它工作项暂时忽略，我们将在扩展对应的内核功能时，再回头进行补充。 第1步 - 清零 BSS 区域 BSS 是构成内核 Image 的一个特殊的数据区，编译器会把程序中未显式初始化的全局变量放到这个区域，这些全局变量默认值都应当是零。但是编译器本身并不执行 BSS 清零工作，这个通常是 ELF 加载器的工作。对于我们正在开发的内核，既然没有其它程序替我们完成，那就只好自己对 BSS 区域清零。 第5步 - 建立栈以支持函数调用 建立栈支持函数调用之后，我们就可以脱离晦涩的汇编语言，进入 Rust 的编程世界，利用 Rust 高级语言提供的各种先进特性实现内核功能。作为 Unikernel 内核，应用与内核都会使用这同一个栈，所以我们直接预分配 256K 的大栈空间，减少将来因栈溢出而带来的困扰。 现在我们就在 axorigin 中引入引导模块 boot，实现上面的两步： // axorigin/src/boot.rs
#[no_mangle]
#[link_section = ".text.boot"]
unsafe extern "C" fn _start() -> ! { // a0 = hartid // a1 = dtb core::arch::asm!(" la a3, _sbss la a4, _ebss ble a4, a3, 2f
1: sd zero, (a3) add a3, a3, 8 blt a3, a4, 1b
2: la sp, boot_stack_top // setup boot stack la a2, {entry} jalr a2 // call rust_entry(hartid, dtb) j .", entry = sym super::rust_entry, options(noreturn), )
} 从 _start 入口 开始，上面这段汇编代码分为三个部分： 第 8~15 行：实现了 BSS 清零，BSS 区域的起止地址是 _sbss 和 _ebss，都定义在 linker.lds 中的 .bss 段中，符号可以被汇编直接引用。 第 17 行：初始化寄存器 sp，指向栈空间的最高地址 - 即栈底位置 boot_stack_top，该符号同样是定义在 linker.lds 文件的 .bss 中。如上图，在 .bss 段的开头，预留了 256K 的空间，并且 boot_stack_top 是空间的最高地址。另外，需要注意的是，这段栈空间并 不 包含在由 _sbss 和 _ebss 标记的范围内，因为栈不需要预先初始化。 第 25 和 26 行：在栈准备好的情况下，首次进入 Rust 函数 rust_entry。 先通过 la 指令取得 rust_entry 的入口地址，然后通过 jalr 调用该地址。按照 RiscV 规范，a0 到 a7 寄存器分别作为函数调用的前 8 个参数，当下只有 a0 和 a1 是有效的。这两个寄存器由上一级引导程序 SBI 设置，a0 保存了 HartID，也就是当前 cpu 核的硬件 ID；a1 则指向了一块内存区，其中保存的是描述底层平台硬件信息的设备树，即 dtb。 从上面的那段汇编代码可以看出，内核从启动到调用 Rust 入口函数过程中，没有使用过 a0 和 a1。如果在这个过程中必须使用它们，就必须先暂存它们的值，然后在调用 rust_entry 前恢复回来。这个就是本节开始时，提到的 第 2 项 任务，将来会看到这种处理的必要性。 最后，看看函数 rust_entry 的定义： // axorigin/src/main.rs
#![no_std]
#![no_main]
#![feature(asm_const)] mod lang_items;
mod boot; unsafe extern "C" fn rust_entry(_hartid: usize, _dtb: usize) { core::arch::asm!( "wfi", options(noreturn) )
} 目前 rust_entry 还干不了任何事，所以仍然调用 wfi 指令。注意它的两个参数 _hartid 和 _dtb ，就是通过 a0 和 a1 寄存器传入的，暂时还用不到它们，但在将来它们会发挥重要作用。 用 make run 编译并执行，然后打开 qemu.log 并跳到末尾，查看从 0x80200000 开始直到 0x80200034 这段范围执行的指令序列，确认它们与我们编写的汇编代码等效。 在 qemu.log 中看到的指令，在形式上与我们编写的汇编指令有一点出入。 主要是因为我们用了一些伪指令，大家可通过 RiscV ASM 手册，查阅这些伪指令与实际指令的对应关系。

12.body:
到目前为止，我们还看不到内核的输出信息，只能通过查看 qemu 跟踪日志，确认工作成果。现在是实现打印输出的时候了！ 有两个办法可以让内核支持 console，一是通过管理 Uart 串口设备进行输出，二是直接调用 OpenSBI 提供的功能。前一个方式需要自己实现驱动，但目前我们连最基础的内存管理都未能完成，缺乏实现驱动的条件；所以决定采用第二个办法。 前面一章提到，OpenSBI 提供了一系列功能调用，可以通过调用号去请求 SBI 为我们完成部分工作。查阅 OpenSBI 文档，发现功能调用 console_putchar 具有打印输出一个字符的能力，正可以作为输出功能的基础。然后从 crate.io 中，我们找到了 sbi-rt 这个现成的库，它封装了对 sbi 功能调用的各种方法。现在就使用它来实现 console 模块。 // axorigin/src/console.rs
pub fn putchar(c: u8) { #[allow(deprecated)] sbi_rt::legacy::console_putchar(c as usize);
} pub fn write_bytes(bytes: &[u8]) { for c in bytes { putchar(*c); }
} 在 Cargo.toml 中，引入对 sbi-rt 的依赖。 // axorigin/Cargo.toml
[dependencies]
sbi-rt = { version = "0.0.2", features = ["legacy"] } 把 mod console 引入 main.rs，把 wfi 指令替换为调用字符串输出。 mod console; unsafe extern "C" fn rust_entry(_hartid: usize, _dtb: usize) { console::write_bytes(b"\nHello, ArceOS!\n");
} 通过 make run 运行，终于在屏幕上看到了输出 “Hello, ArceOS!”。 仅仅支持输出字符串不方便，下面来进一步支持类似 print 的变参输出方式。 首先定义一个代表 Console 的全局变量，实现 Write 这个 Trait： // axorigin/src/console.rs
use core::fmt::{Write, Error}; struct Console; impl Write for Console { fn write_str(&mut self, s: &str) -> Result<(), Error> { write_bytes(s.as_bytes()); Ok(()) }
} pub fn __print_impl(args: core::fmt::Arguments) { Console.write_fmt(args).unwrap();
} 当我们对 Console 调用 write_fmt(...) 时，Rust 库会帮助处理变参，我们只需要实现 write_str(...) 这个 Trait 的方法就可以了。 然后，提供两个宏定义 ax_print! 和 ax_println! 封装输出功能： // axorigin/src/console.rs
#[macro_export]
macro_rules! ax_print { ($($arg:tt)*) => { $crate::console::__print_impl(format_args!($($arg)*)); }
} #[macro_export]
macro_rules! ax_println { () => { $crate::print!("\n") }; ($($arg:tt)*) => { $crate::console::__print_impl(format_args!("{}\n", format_args!($($arg)*))); }
} 最后，在 axorigin 中调用 ax_println! 宏测试一下，删除 console::write_bytes(...) 那一行，替换为 ax_println! 输出： // axorigin/src/main.rs
unsafe extern "C" fn rust_entry(_hartid: usize, _dtb: usize) { let version = 1; ax_println!("\nHello, ArceOS!"); ax_println!("version: [{}]", version);
} 通过 make run 编译运行，看到作为变参的 version 信息输出。显示如下： Hello, ArceOS! version: [1] 目前只能支持 Rust 基本类型，等下一章支持动态内存分配之后，我们再进一步测试对复杂集合类型的输出功能。

13.body:
从本节开始，我们将开启组件化构造操作系统内核的旅程。 与传统构造内核的方法不同，组件化构造内核包括两个部分：一是建立一个组件仓库，其中的组件都具有高度的功能内聚性和可复用性；二是建立一种管理、选择和组合组件的方法与机制。在二者的基础上，我们就可以根据需要，基于组合组件的方式来构建内核。 接下来，我们就对应上面所述的两个部分，分两个步骤进行实验。 第一步：对当前版本的单一内核进行分解，形成最初的组件仓库。 当前内核虽然是 Unikernel 形态，按照功能仍然可以分成系统和应用两层。 系统层 ：迄今为止，我们进行的大部分工作都可以归纳到系统层，大多是针对硬件平台的操作，包括启动模块 boot，控制台模块 console 等等。这些模块的共同特点：对外提供一个抽象的硬件操作接口，内部则封装了针对 RiscV 体系结构和具体硬件的操作。我们希望把上述接口明确固定下来，形成一个稳定的 硬件抽象层 Hardware Abstract Layer （简称 HAL）。以 HAL 分界，实现上下层组件的解耦，方便我们将来对其它体系结构及平台的支持工作。 应用层 ：目前应用层的工作仅仅是调用 console，向屏幕输出 Hello 信息。我们要把 rust_entry 框架从应用中分离出去，因为那些属于系统层的功能。 基于这样的层次划分，我们就分解出最初的两个组件 axhal 和 axorigin。其中，axorigin 继承了原始内核工程的名字，但它的身份已经降级成为一个应用组件，将来必须与 axhal 等系统组件配合来构成完整的 Unikernel 系统。 axhal 组件 封装系统层的模块，从外部形式看，它是一个 lib 形式的 crate。但是从启动角度，由于它的 boot 模块包含了内核的 _start 入口，其实是首先运行的，然后才会去启动应用组件。看一下这个 crate 的根模块 lib.rs 和 Cargo.toml： // axhal/src/lib.rs
#![no_std]
#![no_main] mod lang_items;
mod boot;
pub mod console; unsafe extern "C" fn rust_entry(_hartid: usize, _dtb: usize) { extern "C" { fn main(hartid: usize, dtb: usize); } main(_hartid, _dtb);
} // axhal/Cargo.toml
[package]
name = "axhal"
version = "0.1.0"
edition = "2021" # See more keys and their definitions at https://doc.rust-lang.org/cargo/reference/manifest.html [dependencies]
sbi-rt = { version = "0.0.2", features = ["legacy"] } 组件 axhal 继承了上一版本内核几乎所有的模块，以及 rust_entry 框架，只是把直接调用 console 进行打印的代码，替换成一个外部函数 main，这个 main 函数就是新的应用组件 axorigin 的主函数，其中包含 console 打印。这里可能会产生一个疑问，为什么需要通过 extern ABI 这种外部函数的形式去调用？而不能以引入依赖 crate 的方式去调用？后面会说明这一原因。 axorigin 组件 前面提到了，这个组件只是继承了原来内核工程的名字，目前已经退化成一个应用组件。与组件 axhal 相应的，从外部看，axorigin 具有 main.rs 根模块，形式上就是一个 binary crate；但是它自身是无法运行的，需要等待 axhal 组件启动它。 来看一下 axorigin 当前的 main.rs 实现： #![no_std]
#![no_main] use axhal::ax_println; #[no_mangle]
pub fn main(_hartid: usize, _dtb: usize) { let version = 1; ax_println!("\nHello, ArceOS!"); ax_println!("version: [{}]", version);
} 主体就是一个 main 函数，正对应 axhal 组件在最后阶段要调用的函数，main 是所有应用类型组件的入口。 这个 main，与我们基于 Linux/Windows 平台进行应用编程时写的 main，其实并无关系，上面 #[no_main] 已经说明了这一点。这里起这个名字，只是为了适应编程习惯。 目前，应用组件 axorigin 在 main 函数中要实现的逻辑非常简单，但是它为我们建立了基本的 Unikernel 应用框架；将来在开发 Unikernel 应用时，只需要按此方式创建一个应用组件，并在 main 函数中实现业务逻辑即可。应用逻辑开发与系统功能的实现从此分离。 第二步：对现有的两个组件进行组合，形成可以运行的内核。 既然两个组件都是 Rust crate 的形式，最简单的组合方式，自然就是利用 Cargo 工具提供的 denpendencies 依赖机制进行连接组合。 来看 axorigin 的 Cargo.toml： [package]
name = "axorigin"
version = "0.1.0"
edition = "2021" # See more keys and their definitions at https://doc.rust-lang.org/cargo/reference/manifest.html [dependencies]
axhal = { path = "../axhal" } 建立应用组件 axorigin 对 axhal 的依赖之后，Cargo 就可以自动为我们组合组件构造出内核。 用 git show --stat 比较当前基于组件化的版本与上一版本在代码方面的变化： axorigin/Cargo.toml | 2 +- axorigin/src/main.rs | 8 +++----- {axorigin => axhal}/src/boot.rs | 0 {axorigin => axhal}/src/console.rs | 0 {axorigin => axhal}/src/lang_items.rs | 0 axhal/Cargo.toml | 9 +++++++++ axhal/src/lib.rs | 13 +++++++++++++ 7 files changed, 26 insertions(+), 6 deletions(-) 运行 make run 测试，屏幕输出没有变化。 Hello, ArceOS! version: [1] 但是我们已经步入了组件化构造内核的进程中。 在本节结束之前，解释一下之前的问题：为什么在启动过程中，组件 axhal 必须通过 extern ABI 的方式调用组件 axorigin 的 main 函数。 从图中可以看到，两个组件之间存在相互调用的关系，启动过程中 axhal 调用 axorigin 的 main 函数；运行过程中 axorigin 作为应用需要调用系统组件 axhal 的各种功能。既然 axorigin 已经通过 Cargo.toml 对 axhal 建立了依赖，那么另一个方向的依赖就不成立了，否则就会导致 循环依赖 。因此只好在启动过程中，采用 extern ABI 的方式调用 main 函数。 在我们将来构造内核的实验中，循环依赖将会是一个比较麻烦的问题。在第三章里，将会引入一个特殊的组件 crate_interface 专门用于处理循环依赖，本质上它仍然是基于 extern ABI，但是基于该组件提供了一种 Rusty 风格的调用方式，这样来做，代码的可读性更好，同时可以有效减少编程出错的概率。

14.body:
Rust 工具链本身对测试的支持很方便，下面将基于这一有利条件，对内核的组件和模块进行功能测试验证。组件测试相当于 crate 级的测试，直接在 crate 根目录下建立 tests 模块，对组件进行基于公开接口的黑盒测试；模块测试对应于单元测试，在模块内建立子模块tests，对模块的内部方法进行白盒测试。在 Makefile 中，预留了一个test 命令入口，用于启动上述测试。 我们需要注意一个容易忽略的事实，通过 make run 编译并运行内核，与通过 make test 编译并执行测试，这二者的编译和运行环境是截然不同的，前者的编译目标是 RiscV64 体系结构，并通过 qemu-riscv64 模拟器运行；后者则是针对本地的 x86_64 体系结构，在本地 Linux 上作为应用直接运行（ Linux on x86_64 这应该是我们大多数人的本地开发环境）。因此，通过 Rust 工具链进行测试是有局限的，测试的功能与实际将要运行的功能可能存在差异，测试时还有可能需要一些 dummy 测试桩的辅助。我们需要清醒的保持这一认识，避免在后面的实验开发和测试中陷入困惑。 下面对现有的工程项目进行一些改造，满足测试的需要： Makefile 中 test 命令 调用 cargo test 启动测试： ifeq ($(filter $(MAKECMDGOALS),test),) # not run `cargo test`
RUSTFLAGS := -C link-arg=-T$(LD_SCRIPT) -C link-arg=-no-pie
export RUSTFLAGS
endif test: cargo test --workspace --exclude "axorigin" -- --nocapture 测试针对整个工程 workspace 下包含的所有组件，只是排除 axorigin 应用本身。我们希望测试用例中能够通过 println! 直接输出信息到屏幕，所以指定了 --nocapture 参数。 特别需要注意的是上面的 1~4 行，环境变量 RUSTFLAGS 不能出现在 make test 的过程中，原因前面已经说了，测试时是基于 x86_64 的体系结构，这个环境变量却要求使用面向 RiscV64 的 linker.lds 链接脚本和参数。如果不注意这一点，就会出现如下的错误： = note: /usr/bin/ld: cannot represent machine `riscv' collect2: error: ld returned 1 exit status error: could not compile `axhal` (lib test) due to previous error x86 工具链的链接器在解析 linker.lds 第一行时就发现错误，它不能识别 OUTPUT_ARCH(riscv)，直接报错退出了。 工程 Workspace 级的 Cargo.toml [workspace]
resolver = "2" members = [ "axorigin", "axhal",
] [profile.release]
lto = true 以后增加新组件时，需要扩展 members 列表。 改造 axhal 组件的代码组织结构 组件 axhal 负责屏蔽体系结构的差异，所以它对 make test 所要求的另类环境最为敏感。 首先改造 crate 的 lib.rs： // axhal/src/lib.rs
#![no_std] #[cfg(target_arch = "riscv64")]
mod riscv64;
#[cfg(target_arch = "riscv64")]
pub use self::riscv64::*; // axhal/src/riscv64.rs
mod lang_items;
mod boot;
pub mod console; unsafe extern "C" fn rust_entry(_hartid: usize, _dtb: usize) { extern "C" { fn main(hartid: usize, dtb: usize); } main(_hartid, _dtb);
} 原来 lib.rs 只是针对 RriscV64 的实现，现在下移到 riscv64.rs 模块文件中；相应的，lang_items.rs、boot.rs和 console.rs 三个文件，也移到到目录 riscv64 下。这样只有当目标体系结构是 RriscV64 时，才会引用这些实现，因而执行测试时不会编译它们。 改造 axhal 的 Cargo.toml： [target.'cfg(target_arch = "riscv64")'.dependencies]
sbi-rt = { version = "0.0.2", features = ["legacy"] } 把 [dependencies] 改成带体系结构条件的形式，避免在执行测试时引入 sbi-rt 这个无效引用。 用 git show --stat 看一下改造后的情况： Cargo.toml | 10 ++++++++++ Makefile | 7 ++++++- axhal/Cargo.toml | 2 +- axhal/src/lib.rs | 15 ++++----------- axhal/src/riscv64.rs | 10 ++++++++++ axhal/src/{ => riscv64}/boot.rs | 0 axhal/src/{ => riscv64}/console.rs | 0 axhal/src/{ => riscv64}/lang_items.rs | 0 8 files changed, 31 insertions(+), 13 deletions(-) 分别执行 make run 和 make test，验证我们的成果。 前者的输出没有变化，而执行后者时，显示如下： cargo test --workspace --exclude "axorigin" -- --nocapture Compiling axhal v0.1.0 (/home/cloud/gitStudy/arceos_tutorial/axhal) Finished test [unoptimized + debuginfo] target(s) in 0.20s Running unittests src/lib.rs (target/debug/deps/axhal-0770fa3f3cc1ea75) running 0 tests test result: ok. 0 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out; finished in 0.00s Doc-tests axhal running 0 tests test result: ok. 0 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out; finished in 0.00s 目前还没有写任何测试用例，测试框架只是空转一次。 下节开始，我们将使用测试用例来驱动内核的开发。

15.body:
在本章的最后，增加几个常用工具组件，为后续的实验工作做一个准备。 全局配置组件 axconfig 创建组件 axconfig，主要用来提供全局的配置参数和一些常用的工具函数，它的 lib.rs 就如这样： // axconfig/src/lib.rs
#![no_std] pub const PAGE_SHIFT: usize = 12;
pub const PAGE_SIZE: usize = 1 << PAGE_SHIFT;
pub const PHYS_VIRT_OFFSET: usize = 0xffff_ffc0_0000_0000;
pub const ASPACE_BITS: usize = 39; pub const SIZE_1G: usize = 0x4000_0000;
pub const SIZE_2M: usize = 0x20_0000; #[inline]
pub const fn align_up(val: usize, align: usize) -> usize { (val + align - 1) & !(align - 1)
}
#[inline]
pub const fn align_down(val: usize, align: usize) -> usize { (val) & !(align - 1)
}
#[inline]
pub const fn align_offset(addr: usize, align: usize) -> usize { addr & (align - 1)
}
#[inline]
pub const fn is_aligned(addr: usize, align: usize) -> bool { align_offset(addr, align) == 0
}
#[inline]
pub const fn phys_pfn(pa: usize) -> usize { pa >> PAGE_SHIFT
} 在我们的实验中，页面 Page 采用最常见的 4096 字节。同时提供一组与对齐相关的工具函数。 后面我们会陆续加入更多的配置参数和工具函数。 可以在真正实现 align 相关函数之前，先写好测试用例，以测试驱动的方式开发该组件功能： // axconfig/tests/test_align.rs
use axconfig::{align_up, align_down, PAGE_SIZE}; #[test]
fn test_align_up() { assert_eq!(align_up(23, 16), 32); assert_eq!(align_up(4095, PAGE_SIZE), PAGE_SIZE); assert_eq!(align_up(4096, PAGE_SIZE), PAGE_SIZE); assert_eq!(align_up(4097, PAGE_SIZE), 2*PAGE_SIZE);
} #[test]
fn test_align_down() { assert_eq!(align_down(23, 16), 16); assert_eq!(align_down(4095, PAGE_SIZE), 0); assert_eq!(align_down(4096, PAGE_SIZE), PAGE_SIZE); assert_eq!(align_down(4097, PAGE_SIZE), PAGE_SIZE);
} 上面是组件级的测试用例，直接放在 axconfig/tests 目录下，用于对组件公开接口的测试。 执行 make test，显示测试成功： Running tests/test_align.rs (target/debug/deps/test_align-087b60d36f414a97) running 2 tests test test_align_down ... ok test test_align_up ... ok test result: ok. 2 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out; finished in 0.00s 自旋锁 SpinRaw 在真正启动多任务和启用中断之前，内核一直处于纯粹的单线程执行状态，没有任何并发，自然也没有同步的问题，当前对于全局变量的修改是安全的。但是 Rust 不清楚这一点，所以我们需要先实现一个最初版本的自旋锁 SpinRaw，用它包装 mutable 全局变量，假装已经有了同步保护，但实际上它目前只是个空壳。 创建组件 spinlock，在模块 raw.rs 中实现 SpinRaw 类型。 // spinlock/src/lib.rs
#![no_std] mod raw;
pub use raw::{SpinRaw, SpinRawGuard}; // spinlock/src/raw.rs
use core::cell::UnsafeCell;
use core::ops::{Deref, DerefMut}; pub struct SpinRaw<T> { data: UnsafeCell<T>,
} pub struct SpinRawGuard<T> { data: *mut T,
} unsafe impl<T> Sync for SpinRaw<T> {}
unsafe impl<T> Send for SpinRaw<T> {} impl<T> SpinRaw<T> { #[inline(always)] pub const fn new(data: T) -> Self { Self { data: UnsafeCell::new(data), } } #[inline(always)] pub fn lock(&self) -> SpinRawGuard<T> { SpinRawGuard { data: unsafe { &mut *self.data.get() }, } }
} 按照 Rust 要求，标记 SpinRaw 具有 Send 和 Sync 的标记 trait。 实现 lock 方法返回 SpinRawGuard，假装这个 guard 持有了锁，guard 是 RAII 的模式，当它释放即执行 drop 方法时自动解锁。目前没有实际解锁动作，直接 忽略 对 Drop trait 的实现。 然后我们为 guard 实现 Deref 和 DerefMut 两个 Trait，把它作为智能指针以方便直接访问 SpinRaw 包装变量的方法。 // spinlock/src/raw.rs
impl<T> Deref for SpinRawGuard<T> { type Target = T; #[inline(always)] fn deref(&self) -> &T { unsafe { &*self.data } }
} impl<T> DerefMut for SpinRawGuard<T> { #[inline(always)] fn deref_mut(&mut self) -> &mut T { unsafe { &mut *self.data } }
} 编写测试用例，验证对外公开的组件接口功能： // spinlock/tests/test_raw.rs
use spinlock::SpinRaw; struct Inner { val: usize,
} impl Inner { const fn new() -> Self { Self { val: 0 } } fn set(&mut self, v: usize) { self.val = v; } fn get(&self) -> usize { self.val }
} static SPIN: SpinRaw<Inner> = SpinRaw::new(Inner::new()); #[test]
fn test_lock() { SPIN.lock().set(1); assert_eq!(SPIN.lock().get(), 1);
} 执行 make test 测试，显示： Running tests/test_raw.rs (target/debug/deps/test_raw-70e610058ffa9914) running 1 test test test_lock ... ok test result: ok. 1 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out; finished in 0.00s BootOnceCell 类似于上面情况，有些全局变量虽然需要设置，但是仅需要一次，之后就一直是只读状态，这属于延迟初始化的一种。 例如下一章马上要涉及的早期页表根目录 KERNEL_PAGE_TABLE，这个全局变量只需要初始化一次，但是负责初始化的是一个函数，没法在定义时直接调用，只能延迟初始化。那么就可以借助这个 BootOnceCell 来封装 KERNEL_PAGE_TABLE。 创建组件 axsync，在模块 bootcell.rs 中实现类型 BootOnceCell。 // axsync/src/lib.rs
#![no_std] mod bootcell;
pub use bootcell::BootOnceCell; // axsync/src/bootcell.rs
use core::cell::OnceCell; pub struct BootOnceCell<T> { inner: OnceCell<T>,
} impl<T> BootOnceCell<T> { pub const fn new() -> Self { Self { inner: OnceCell::new() } } pub fn init(&self, val: T) { let _ = self.inner.set(val); } pub fn get(&self) -> &T { self.inner.get().unwrap() } pub fn is_init(&self) -> bool { self.inner.get().is_some() }
} unsafe impl<T> Sync for BootOnceCell<T> {} 注意两点： 我们以 Rust 库提供的 OnceCell 为基础进行实现，比较简便。 顾名思义，BootOnceCell 的那一次初始化调用必须在 Boot 阶段，即单线程环境下完成，之后就变成了只读变量，这样再启用多线程也没有问题。但如果初始化操作是在启用多线程或中断之后再进行，就是 不安全 的。一定注意这个调用时机。 BootOnceCell 是对 lazy_static 的替代实现。 对应的测试用例如下： // axsync/tests/test_bootcell.rs
use axsync::BootOnceCell; static TEST: BootOnceCell<usize> = BootOnceCell::new(); #[test]
fn test_bootcell() { assert!(!TEST.is_init()); TEST.init(101); assert_eq!(TEST.get(), &101); assert!(TEST.is_init());
} 执行 make test 测试，显示： Running tests/test_bootcell.rs (target/debug/deps/test_bootcell-3224367d8bbd079d) running 1 test test test_bootcell ... ok test result: ok. 1 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out; finished in 0.00s

