现在我们来为内核正式实现日志组件 axlog。在 crates.io 中已经有一个非常通用的日志 crate - log，它主要用于普通应用的开发；本节我们将以它为基础进行封装和扩展，满足内核对日志设施的需要。 首先实现日志的初始化过程和级别设置： // axlog/Cargo.toml
[dependencies]
log = "0.4"
crate_interface = "0.1.1" // axlog/src/lib.rs
#![no_std] use core::fmt::{self, Write};
use core::str::FromStr;
use crate_interface::call_interface;
use log::{Level, LevelFilter, Log, Metadata, Record};
pub use log::{debug, error, info, trace, warn}; #[crate_interface::def_interface]
pub trait LogIf { fn write_str(s: &str); fn get_time() -> core::time::Duration;
} struct Logger; pub fn init() { log::set_logger(&Logger).unwrap(); log::set_max_level(LevelFilter::Warn);
} pub fn set_max_level(level: &str) { let lf = LevelFilter::from_str(level).ok().unwrap_or(LevelFilter::Off); log::set_max_level(lf);
} 第 4 行：Cargo.toml 引入 log 和 crate_interface 两个 crates。 第 21 行：全局的日志实例 Logger，它代表了日志对象，将来对日志的各种操作主要都是针对它。 第 23~26 行：上一节 init() 的实现仅是为了测试 crate_interface，这里重新实现。先是指定日志对象，然后设置默认日志级别 warn。 第 28~31 行：控制日志级别 set_max_level，支持关闭 off 以及 error, warn, info, debug, trace5 个级别。默认是 warn 级，即默认情况下只输出警告与错误。 然后，最重要的一步，按照 crate log 的实现要求，为 Logger 实现 trait Log 接口。这个外部的 crate log 本身是一个框架，实现了日志的各种通用功能，但是如何对日志进行输出需要基于所在的环境，这个 trait Log 就是通用功能与环境交互的接口。 下面列出实现 Log 接口的具体逻辑： macro_rules! with_color { ($color_code:expr, $($arg:tt)*) => {{ format_args!("\u{1B}[{}m{}\u{1B}[m", $color_code as u8, format_args!($($arg)*)) }};
} #[repr(u8)]
#[allow(dead_code)]
enum ColorCode { Red = 31, Green = 32, Yellow = 33, Cyan = 36, White = 37, BrightBlack = 90,
} impl Log for Logger { #[inline] fn enabled(&self, _metadata: &Metadata) -> bool { true } fn log(&self, record: &Record) { let level = record.level(); let line = record.line().unwrap_or(0); let path = record.target(); let args_color = match level { Level::Error => ColorCode::Red, Level::Warn => ColorCode::Yellow, Level::Info => ColorCode::Green, Level::Debug => ColorCode::Cyan, Level::Trace => ColorCode::BrightBlack, }; let now = call_interface!(LogIf::get_time); print_fmt(with_color!( ColorCode::White, "[{:>3}.{:06} {path}:{line}] {args}\n", now.as_secs(), now.subsec_micros(), path = path, line = line, args = with_color!(args_color, "{}", record.args()), )); } fn flush(&self) {}
} 第 1~11 行：为日志输出功能准备一个宏 with_color 和颜色代码，后面将根据级别为日志文本增加不同的颜色。 第 13~17 行：是否启用日志功能，硬编码启用即可。 第 19~41 行：Log::log 方法是关键，准备好显示颜色、当前时间、当前模块路径、行号以及日志内容等一系列参数，然后调用 print_fmt 执行日志的输出功能。 第 43 行：flush 刷新日志缓存。我们内核日志目前只是打印到屏幕，不涉及刷新，所以忽略。 下一步来看 print_fmt 的具体实现： impl Write for Logger { fn write_str(&mut self, s: &str) -> fmt::Result { call_interface!(LogIf::write_str, s); Ok(()) }
} pub fn print_fmt(args: fmt::Arguments) { let _ = Logger.write_fmt(args);
} 第 1~6 行：为 Logger 实现 Write trait，目的是借助 Rust 提供的这个 trait，完成从变参到最终字符串的转换。我们只需要实现 write_str 方法，输入参数已经是处理好的结果字符串，然后通过 call_interface 调用 axhal 中实现的 LogIf::write_str 来完成日志输出。 第 8~10 行：print_fmt 的实现。既然 Logger 已经实现了 Write trait，我们只需要调用 Logger 的 write_fmt 方法，Logger 就会自动处理变参，进而如上面所述，通过 write_str 进行输出。 上面已经完成了 axlog 的实现，下面在 axruntime 中初始化 axlog，并尝试打印两行日志： #![no_std] pub use axhal::ax_println as println; #[macro_use]
extern crate axlog; #[no_mangle]
pub extern "C" fn rust_main(hartid: usize, dtb: usize) -> ! { extern "C" { fn _skernel(); fn main(); } println!("\nArceOS is starting ..."); // We reserve 2M memory range [0x80000000, 0x80200000) for SBI, // but it only occupies ~194K. Split this range in half, // requisition the higher part(1M) for early heap. axalloc::early_init(_skernel as usize - 0x100000, 0x100000); axlog::init(); axlog::set_max_level(option_env!("LOG").unwrap_or("")); info!("Logging is enabled."); info!("Primary CPU {} started, dtb = {:#x}.", hartid, dtb); unsafe { main(); } loop {}
} 第 22 行：初始化 axlog 组件。上节已经实现这行。 第 23 行：通过 make 传入外部环境变量 LOG，指定日志级别。 第 24~25 行：打印两行日志到屏幕。 执行 make run LOG=info 验证 axlog 是否能够完成日志初始化和 info 级别的日志输出： ArceOS is starting ... [ 0.098586 axruntime:24] Logging is enabled. [ 0.103594 axruntime:25] Primary CPU 0 started, dtb = 0x87000000. Now: 0.107696 Hello, ArceOS![from String] Elapsed: 0.002323 在屏幕输出中显示了我们记录的 info 日志，axlog 验证成功！ 之前我们的内核已经实现了一个最简单的 panic，处理方式就是进入无限循环等待。本节来完善对它的实现。 // axhal/src/riscv64/lang_items.rs
use axlog::error; #[panic_handler]
fn panic(info: &PanicInfo) -> ! { error!("{}", info); axhal::misc::terminate()
} 很简单，先打印错误信息日志，然后内核中止运行。对于中止运行这个功能，我们需要扩展一下 axhal 组件。 // axhal/src/riscv64/misc.rs
pub fn terminate() -> ! { sbi_rt::system_reset(sbi_rt::Shutdown, sbi_rt::NoReason); loop {}
} // axhal/src/riscv64.rs
mod misc;
pub use misc::terminate; 既然有了 terminate 功能，我们把 axruntime 的 rust_main 函数最后一行 loop {}，直接替换为 terminate()，如下： // axruntime/src/lib.rs
#[no_mangle]
pub extern "C" fn rust_main(hartid: usize, dtb: usize) -> ! { ... ... unsafe { main(); } axhal::terminate();
} 再次执行 make run，查看执行结果： ArceOS is starting ... Now: 0.098169 Hello, ArceOS![from String] Elapsed: 0.003439 结果显示没有变化，但是内核执行完毕后 自动 就退出了，不再需要 ctrl + A +X 退出 qemu，方便了以后对内核的开发测试。

29.body:
在第二章的第一节中，我们已经学习了如何通过 qemu 命令行，导出平台的配置信息。 这一节来到了内核在启动早期的一个重要环节，让内核自己解析 fdt 设备树来获得硬件平台的配置情况，作为后面启动过程的基础。 回顾一下，内核最初启动时从 SBI 得到两个参数分别在 a0 和 a1 寄存器中。其中 a1 寄存器保存的是 dtb 的开始地址，而 dtb 就是 fdt 的二进制形式，它的全称 device tree blob。由于它已经在内存中放置好，内核启动时就可以直接解析它的内容获取信息。 首先来了解一下标准 dtb 文件的布局规定： 我们内核要解析的 dtb 内存块实际就是 dtb 文件在内存中的映射，主要包含四个部分： 头结构 header：固定长度和格式，保存着全局信息和后面各个部分的相对偏移，所以解析 header 是解析整个 dtb 的第一步。 保留的内存区域信息：这部分我们暂时用不到。跳过。 主体结构：dtb 主体是由 Node 构成的树型结构，每个 Node 可以有自己的 properties。这个是我们要解析的主体，后面重点说明。 字符串表：一系列将被 Node 引用的字符串信息，由于每个字符串都是不定长的，所以把它们集中归置成一个块，并放到最后。 下面开始创建 axdtb 组件，首先给出解析设备树所需的常量和错误定义： // axdtb/src/lib.rs
#![no_std] use core::str;
use axconfig::align_up; mod util;
pub use crate::util::SliceRead; extern crate alloc;
use alloc::{borrow::ToOwned, string::String, vec::Vec}; const MAGIC_NUMBER : u32 = 0xd00dfeed;
const SUPPORTED_VERSION: u32 = 17;
const OF_DT_BEGIN_NODE : u32 = 0x00000001;
const OF_DT_END_NODE : u32 = 0x00000002;
const OF_DT_PROP : u32 = 0x00000003; #[derive(Debug)]
pub enum DeviceTreeError { BadMagicNumber, SliceReadError, VersionNotSupported, ParseError(usize), Utf8Error,
} pub type DeviceTreeResult<T> = Result<T, DeviceTreeError>; 第 13~17 行：规范对设备树文件中各个常量的定义。 第 19~28 行：解析设备树过程中需要的错误类型定义。 定义 DeviceTree 作为主类型： // axdtb/src/lib.rs
pub struct DeviceTree { ptr: usize, totalsize: usize, pub off_struct: usize, off_strings: usize,
} impl DeviceTree { pub fn init(ptr: usize) -> DeviceTreeResult<Self> { let buf = unsafe { core::slice::from_raw_parts(ptr as *const u8, 24) }; if buf.read_be_u32(0)? != MAGIC_NUMBER { return Err(DeviceTreeError::BadMagicNumber) } if buf.read_be_u32(20)? != SUPPORTED_VERSION { return Err(DeviceTreeError::VersionNotSupported); } let totalsize = buf.read_be_u32(4)? as usize; let off_struct = buf.read_be_u32(8)? as usize; let off_strings = buf.read_be_u32(12)? as usize; Ok( Self {ptr, totalsize, off_struct, off_strings} ) }
} 第 2~7 行：定义设备树的数据结构 DeviceTree，其中 ptr 和 totalsize 保持 dtb 内存块开始地址和总长度，另外两个成员分别是主体结构和字符串表的偏移。整个 DeviceTree 结构实际就对应于 dtb header。 第 10~29 行：初始化方法 init()，解析 dtb header，首先校验 magic 和版本，然后取出 header 的基本信息填充 DeviceTree 实例。 完成 header 信息解析后，后面主要的任务就是通过 off_struct 标记的偏移，解析 dtb 主体结构。前面提到，dtb 主体结构是一个由 Node 构成的树型结构，来看一下这棵树的示意图： 每一个节点 Node 由两部分组成，属性列表 properties 和子节点 Node 列表。每个属性 property 是 key - value 的形式。每个子节点重复上述的构成。从实现的角度，我们当然可以定义 Node 的数据结构，并在解析 dtb 时申请内存构建 Node 实例，如此逐渐构成一棵树，这样以后就可以随时遍历它获取目标信息。但是这种方式比较耗费内存资源，而我们内核目前只能使用 1M 的动态内存堆，所以考虑了另外一种方案：从 dtb 根节点开始，进行一次性的深度优先递归遍历，每遍历到一个节点 Node，就把它的信息传递给一个回调函数（闭包）处理。这种方案比较节省内存，并且目前不需要定义 Node 数据结构，我们在调用回调函数时，可以直接把 Node 的各个属性直接传入。 回调闭包的形式是 FnMut(String, usize, usize, Vec<(String, Vec<u8>)>，四个参数按顺序分别是节点 Node 的名称、#address-cells、#size-cells 和属性列表，每个属性都是名值对形式。关于 #address-cells 和 #size-cells，它们用于指明如何解释当前 Node 及下级 Node 的 reg 属性，在第二章第一节已经说明了它们的作用。 下面来实现解析 dtb 主体部分的方法 parse： // axdtb/src/lib.rs
impl DeviceTree { pub fn parse( &self, mut pos: usize, mut addr_cells: usize, mut size_cells: usize, cb: &mut dyn FnMut(String, usize, usize, Vec<(String, Vec<u8>)>) ) -> DeviceTreeResult<usize> { let buf = unsafe { core::slice::from_raw_parts(self.ptr as *const u8, self.totalsize) }; // check for DT_BEGIN_NODE if buf.read_be_u32(pos)? != OF_DT_BEGIN_NODE { return Err(DeviceTreeError::ParseError(pos)) } pos += 4; let raw_name = buf.read_bstring0(pos)?; pos = align_up(pos + raw_name.len() + 1, 4); // First, read all the props. let mut props = Vec::new(); while buf.read_be_u32(pos)? == OF_DT_PROP { let val_size = buf.read_be_u32(pos+4)? as usize; let name_offset = buf.read_be_u32(pos+8)? as usize; // get value slice let val_start = pos + 12; let val_end = val_start + val_size; let val = buf.subslice(val_start, val_end)?; // lookup name in strings table let prop_name = buf.read_bstring0(self.off_strings + name_offset)?; let prop_name = str::from_utf8(prop_name)?.to_owned(); if prop_name == "#address-cells" { addr_cells = val.read_be_u32(0)? as usize; } else if prop_name == "#size-cells" { size_cells = val.read_be_u32(0)? as usize; } props.push((prop_name, val.to_owned())); pos = align_up(val_end, 4); } // Callback for parsing dtb let name = str::from_utf8(raw_name)?.to_owned(); cb(name, addr_cells, size_cells, props); // Then, parse all its children. while buf.read_be_u32(pos)? == OF_DT_BEGIN_NODE { pos = self.parse(pos, addr_cells, size_cells, cb)?; } if buf.read_be_u32(pos)? != OF_DT_END_NODE { return Err(DeviceTreeError::ParseError(pos)) } pos += 4; Ok(pos) }
} impl From<str::Utf8Error> for DeviceTreeError { fn from(_: str::Utf8Error) -> DeviceTreeError { DeviceTreeError::Utf8Error }
} 第 4 行：参数 pos 从 off_struct 开始，跟踪当前解析到达的位置； 第 5~6 行：参数 addr_cells 和 size_cells 分别是当前节点 Node 中，地址&长度属性包含的 cells 的个数，每个 cell 是一个大端表示的 32 位数值，是拼接地址和长度的基本元素； 第 7 行：参数 cb 传入处理节点的回调闭包。在递归过程中，它保持不变一直传递下去。 第 13~15 行：确保当前正在解析的是一个 Node 节点。 第 18 行：读出当前节点的名称，并在第 41 行把它从字节串转换成字符串。 第 22~39 行：解析节点所有的属性，把他们组成属性列表。 第 42 行：调用 cb 回调函数，传入当前节点的名称、addr_cells 和 size_cells 和属性列表。这个 cb 回调函数就是 axdtb 框架与具体处理逻辑之间的接口，下一节我们通过实现它来获取我们期望的物理内存长度和 virtio 信息。 第 44~46 行：对每个子节点递归调用 parse 方法。注意发生变化的除了 pos 这个扫描位置之外，addr_cells 和 size_cells也 有可能变化，子节点如果有这两个属性，可以覆盖父节点的属性值，即局部可以在自己的域范围内覆盖上级域的配置。 解析内容时，会对 slice 调用 read_be_[u32|u64] 方法，把大端的数值转换为小端序。这个不是 slice 的标准功能，需要我们自己实现一个 trait，其中包含 read_be_u32 在内的四个附加处理方法。 // axdtb/src/util.rs
use crate::{DeviceTreeResult, DeviceTreeError}; pub trait SliceRead { fn read_be_u32(&self, pos: usize) -> DeviceTreeResult<u32>; fn read_be_u64(&self, pos: usize) -> DeviceTreeResult<u64>; fn read_bstring0(&self, pos: usize) -> DeviceTreeResult<&[u8]>; fn subslice(&self, start: usize, len: usize) -> DeviceTreeResult<&[u8]>;
} impl<'a> SliceRead for &'a [u8] { fn read_be_u32(&self, pos: usize) -> DeviceTreeResult<u32> { // check size is valid if ! (pos+4 <= self.len()) { return Err(DeviceTreeError::SliceReadError) } Ok( (self[pos] as u32) << 24 | (self[pos+1] as u32) << 16 | (self[pos+2] as u32) << 8 | (self[pos+3] as u32) ) } fn read_be_u64(&self, pos: usize) -> DeviceTreeResult<u64> { let hi: u64 = self.read_be_u32(pos)?.into(); let lo: u64 = self.read_be_u32(pos+4)?.into(); Ok((hi << 32) | lo) } fn read_bstring0(&self, pos: usize) -> DeviceTreeResult<&[u8]> { let mut cur = pos; while cur < self.len() { if self[cur] == 0 { return Ok(&self[pos..cur]) } cur += 1; } Err(DeviceTreeError::SliceReadError) } fn subslice(&self, start: usize, end: usize) -> DeviceTreeResult<&[u8]> { if ! (end < self.len()) { return Err(DeviceTreeError::SliceReadError) } Ok(&self[start..end]) }
} 第 4~9 行：定义一个针对 slice 的新的 trait，用来处理大小端的转换。 第 11~45 行：为 slice 实现上述 trait。重点是 read_be_u32 和 read_be_u64，逆转字节序以适应我们内核的需要。 至此，axdtb 组件本身已经实现。下面来测试一下： 先建立一个用于测试的设备树文件 sample.dts， /dts-v1/; / { #address-cells = <0x2>; #size-cells = <0x2>; compatible = "riscv-virtio"; soc { #address-cells = <0x2>; #size-cells = <0x2>; compatible = "simple-bus"; virtio_mmio@10001000 { reg = <0x0 0x10001000 0x0 0x1000>; compatible = "virtio,mmio"; }; };
}; 执行如下命令把它转化为二进制格式，我们在第二章第一节使用过该命令，只是转化方向与这里是相反的。 dtc ./sample.dts -o ./sample.dtb 编写测试用例： // axdtb/tests/test_dtb.rs
use std::str;
use std::io::Read;
use axdtb::SliceRead; #[test]
fn test_dtb() { let mut input = std::fs::File::open("tests/sample.dtb").unwrap(); let mut buf = Vec::new(); input.read_to_end(&mut buf).unwrap(); let mut cb = |name: String, addr_cells: usize, size_cells: usize, props: Vec<(String, Vec<u8>)>| { match name.as_str() { "" => { assert_eq!(addr_cells, 2); assert_eq!(size_cells, 2); for prop in &props { if prop.0.as_str() == "compatible" { assert_eq!(str::from_utf8(&(prop.1)), Ok("riscv-virtio\0")); } } }, "soc" => { assert_eq!(addr_cells, 2); assert_eq!(size_cells, 2); for prop in &props { if prop.0.as_str() == "compatible" { assert_eq!(str::from_utf8(&(prop.1)), Ok("simple-bus\0")); } } }, "virtio_mmio@10001000" => { assert_eq!(addr_cells, 2); assert_eq!(size_cells, 2); for prop in &props { if prop.0.as_str() == "compatible" { assert_eq!(str::from_utf8(&(prop.1)), Ok("virtio,mmio\0")); } else if prop.0.as_str() == "reg" { let reg = &(prop.1); assert_eq!(reg.as_slice().read_be_u64(0).unwrap(), 0x10001000); assert_eq!(reg.as_slice().read_be_u64(8).unwrap(), 0x1000); } } }, _ => {} } }; let dt = axdtb::DeviceTree::init(buf.as_slice().as_ptr() as usize).unwrap(); assert_eq!(dt.parse(dt.off_struct, 0, 0, &mut cb).unwrap(), 396);
} 第 12~47 行：测试用例主要是编写这个回调闭包，过滤测试文件的目标节点进行解析并验证结果。 第 49~50 行：初始化设备树对象，然后启动 parse 过程，每遇到一个节点 Node，都会自动调用上面的 cb 回调函数进行处理。 执行 make test 进行测试，成功！

30.body:
下面就可以基于 axdtb 组件来解析硬件平台的设备树信息，我们首先要知道的是物理内存的上限和各个 mmio 范围。基于这两个信息，在下一章中，我们的内核将重建地址空间并建立正式的内存动态分配机制。 首先来实现解析函数 parse_dtb，从设备树中解析物理内存上限和各个 mmio 范围。 // axruntime/src/lib.rs
extern crate alloc; use core::str;
use alloc::string::String;
use alloc::vec::Vec;
use axdtb::SliceRead;
use axconfig::phys_to_virt; struct DtbInfo { memory_addr: usize, memory_size: usize, mmio_regions: Vec<(usize, usize)>,
} fn parse_dtb(dtb_pa: usize) -> axdtb::DeviceTreeResult<DtbInfo> { let dtb_va = phys_to_virt(dtb_pa); let mut memory_addr = 0; let mut memory_size = 0; let mut mmio_regions = Vec::new(); let mut cb = |_name: String, addr_cells: usize, size_cells: usize, props: Vec<(String, Vec<u8>)>| { let mut is_memory = false; let mut is_mmio = false; let mut reg = None; for prop in props { match prop.0.as_str() { "device_type" => { is_memory = str::from_utf8(&(prop.1)) .map_or_else(|_| false, |v| v == "memory\0"); }, "compatible" => { is_mmio = str::from_utf8(&(prop.1)) .map_or_else(|_| false, |v| v == "virtio,mmio\0"); }, "reg" => { reg = Some(prop.1); }, _ => (), } } if is_memory { assert!(addr_cells == 2); assert!(size_cells == 2); if let Some(ref reg) = reg { memory_addr = reg.as_slice().read_be_u64(0).unwrap() as usize; memory_size = reg.as_slice().read_be_u64(8).unwrap() as usize; } } if is_mmio { assert!(addr_cells == 2); assert!(size_cells == 2); if let Some(ref reg) = reg { let addr = reg.as_slice().read_be_u64(0).unwrap() as usize; let size = reg.as_slice().read_be_u64(8).unwrap() as usize; mmio_regions.push((addr, size)); } } }; let dt = axdtb::DeviceTree::init(dtb_va.into())?; dt.parse(dt.off_struct, 0, 0, &mut cb)?; Ok(DtbInfo {memory_addr, memory_size, mmio_regions})
} 第 10~14 行：定义返回解释结果的结构体，包括物理内存的开始地址和长度以及 virtio_mmio 地址范围列表。 第 27~42 行：设备树中，物理内存节点的 device_type 是 "memory"；而 virtio_mmio 的 compatible 是 "virtio,mmio"。过滤出这两种节点，并取出它们的地址范围信息，此类信息记录在 reg 属性中。 第 43~50 行：读出物理内存的地址范围信息。 第 51~59 行：读出 VirtIO_MMIO 的地址范围信息。 第 62~63 行：从设备树的 off_struct 指向的位置开始解析。 在 axruntime 中调用 axdtb 解析平台信息，位置就在初始化日志组件 axlog 之后： // axruntime/src/lib.rs
#[no_mangle]
pub extern "C" fn rust_main(hartid: usize, dtb: usize) -> ! { ... ... axlog::init(); axlog::set_max_level(option_env!("LOG").unwrap_or("")); // no effect if set `log-level-*` features info!("Logging is enabled."); info!("Primary CPU {} started, dtb = {:#x}.", hartid, dtb); // Parse fdt for early memory info let dtb_info = match parse_dtb(dtb.into()) { Ok(info) => info, Err(err) => panic!("Bad dtb {:?}", err), }; info!("Memory: {:#x}, size: {:#x}", dtb_info.memory_addr, dtb_info.memory_size); info!("Virtio_mmio[{}]:", dtb_info.mmio_regions.len()); for r in &dtb_info.mmio_regions { info!("\t{:#x}, size: {:#x}", r.0, r.1); } ... ...
} // axruntime/Cargo.toml
[dependencies]
axdtb = { path = "../axdtb" }
axconfig = { path = "../axconfig" } 第 11~15 行：调用上面的 parse_dtb 开始扫描整个设备树，期间会触发我们注册的回调闭包。每发现一个节点，cb 就会被调用一次，从中过滤出我们需要的两组信息：一是物理内存的开始地址和总的大小，二是 virtio_mmio 范围列表。 第 17~21 行：展示从设备树中解析获得的物理内存的开始地址和长度以及 virtio_mmio 地址范围列表。 上面过程中需要调用 phys_to_virt 把 dtb 块的物理地址转换为虚拟地址，所以最后扩展一下 axconfig 的实现，增加这个地址转换函数和它对应的反向转换函数。 #[inline]
pub const fn phys_to_virt(pa: usize) -> usize { pa.wrapping_add(PHYS_VIRT_OFFSET)
}
#[inline]
pub const fn virt_to_phys(va: usize) -> usize { va.wrapping_sub(PHYS_VIRT_OFFSET)
