where F: FnOnce() -> T + 'static, T: 'static,
{ Builder::new().spawn(f).expect("failed to spawn thread")
} #[derive(Debug)]
pub struct Builder { // A name for the thread-to-be, for identification in panic messages name: Option<String>, // The size of the stack for the spawned thread in bytes stack_size: Option<usize>,
} impl Builder { pub const fn new() -> Builder { Builder { name: None, stack_size: None, } } pub fn spawn<F, T>(self, f: F) -> io::Result<JoinHandle<T>> where F: FnOnce() -> T + 'static, F: 'static, T: 'static, { unsafe { self.spawn_unchecked(f) } } unsafe fn spawn_unchecked<F, T>(self, f: F) -> Result<JoinHandle<T>> where F: FnOnce() -> T + 'static, F: 'static, T: 'static, { let name = self.name.unwrap_or_default(); let stack_size = self .stack_size .unwrap_or(axconfig::TASK_STACK_SIZE); let my_packet = Arc::new(Packet { result: UnsafeCell::new(None), }); let their_packet = my_packet.clone(); let main = move || { let ret = f(); unsafe { *their_packet.result.get() = Some(ret) }; drop(their_packet); }; let inner = axtask::spawn_raw(main, name, stack_size); let task = AxTaskHandle { id: inner.id().as_u64(), inner, }; Ok(JoinHandle { thread: Thread::from_id(task.id), native: task, packet: my_packet, }) }
