impl TaskContext { pub const fn new() -> Self { unsafe { core::mem::MaybeUninit::zeroed().assume_init() } } pub fn init(&mut self, entry: usize, kstack_top: usize) { self.sp = kstack_top; self.ra = entry; } pub fn switch_to(&mut self, next_ctx: &Self) { unsafe { context_switch(self, next_ctx) } }
