unsafe extern "C" fn context_switch(_current_task: &mut TaskContext, _next_task: &TaskContext) { asm!(" // save old context (callee-saved registers) sd ra, 0*8(a0) sd sp, 1*8(a0) sd s0, 2*8(a0) sd s1, 3*8(a0) sd s2, 4*8(a0) sd s3, 5*8(a0) sd s4, 6*8(a0) sd s5, 7*8(a0) sd s6, 8*8(a0) sd s7, 9*8(a0) sd s8, 10*8(a0) sd s9, 11*8(a0) sd s10, 12*8(a0) sd s11, 13*8(a0) // restore new context ld s11, 13*8(a1) ld s10, 12*8(a1) ld s9, 11*8(a1) ld s8, 10*8(a1) ld s7, 9*8(a1) ld s6, 8*8(a1) ld s5, 7*8(a1) ld s4, 6*8(a1) ld s3, 5*8(a1) ld s2, 4*8(a1) ld s1, 3*8(a1) ld s0, 2*8(a1) ld sp, 1*8(a1) ld ra, 0*8(a1) ret", options(noreturn), )
} 所谓上下文，就是能够保持任务状态的一组寄存器，从 context_switch 可以看出，寄存器组包括 ra、sp 和 s0~s11，处理过程就是把当前这组寄存器的值保存到上一个任务的 ctx 上下文中，然后用下一个任务的 ctx 上下文中保存的值来恢复对应的寄存器。 其中，ra 寄存器是函数返回后要执行的下一条指令地址，对它进行切换的效果：context_switch 返回后 竟然 不是返回到原任务执行流，而是返回到另一个执行流中；sp 寄存器指向栈，它保持了函数压栈的信息，所以在执行流切换的同时，栈也必须切换；s0~s11 是按照 RiscV 规范必须由被调用者负责保存的寄存器，因此一并放到上下文中随任务切换。context_switch 的执行效果如下： 从图中可见，context_switch(...) 是一个非常特殊的函数，当前任务进入函数后被挂起；等函数返回时，继续执行的往往是另一个任务。 现在已经支持了任务调度的完整过程，内核从 MainTask 切换到了新建的 AppTask。AppTask 完成自己的工作之后，将会通过 exit 退出。我们在前面实现 task_entry(...) 时，最后一行就是 exit，所以应用任务不必显式调用它。下面来完善 exit 的实现。 应用任务退出 - exit 上一节实现了 exit 的框架，不过只是针对 MainTask 的情况。对于应用任务 AppTask，它退出时不会导致系统退出，只是通知系统对其资源进行回收。因此我们需要对 exit 进行分支处理： // axtask/src/run_queue.rs
impl AxRunQueue { pub fn exit_current(&mut self, exit_code: i32) -> ! { let curr = current(); if curr.is_init() { axhal::misc::terminate(); } else { curr.set_state(TaskState::Exited); // Save exit code and notify kernel to reclaim itself. self.resched(false); } unreachable!("task exited!"); }
} 任务 Task 的成员 is_init 标记自己是否就是 MainTask。对于普通的 AppTask，先设置 Exited 状态，然后记录退出码和通知内核回收，最后触发一次 resched 调度，把执行权再切换出去，它的使命已经完成，就等着被回收了。中间那一步“记录退出码和通知内核回收”暂缺，我们到下一节再补充相关的机制。 主任务 MainTask 调用 join 等待 AppTask 退出 这一步与 AppTask 的 exit 退出相对应，下一节专门讨论。 先来验证一下我们目前的成果： 执行成功！

