} 此外，为 Idle 任务的使用，在 resched(...) 方法中打个补丁： impl AxRunQueue { fn resched(&mut self, preempt: bool) { ... .... let next = self.pick_next_task().unwrap_or_else(|| IDLE_TASK.get().clone()); self.switch_to(prev, next); }
