}; pub fn dispatch_irq(scause: usize) { match scause { S_TIMER => { log::trace!("IRQ: timer"); TIMER_HANDLER.get()(); }, _ => panic!("invalid trap cause: {:#x}", scause), }
} pub fn register_handler(scause: usize, handler: IrqHandler) -> bool { match scause { S_TIMER => { if !TIMER_HANDLER.is_init() { TIMER_HANDLER.init(handler); true } else { false } }, _ => panic!("invalid trap cause: {:#x}", scause), }
